<!doctype html>
<html lang="en">

<head>
  <meta charset="UTF-8" />
  <meta name="viewport" content="width=device-width, initial-scale=1.0" />
  <title>たこやきをクルクル回そう</title>
  <style>
    * {
      margin: 0;
      padding: 0;
      box-sizing: border-box;
    }

    body {
      background: url(./images/space.jpg) no-repeat center center / cover;
    }
  </style>
</head>

<body>
  <script type="importmap">
    {
      "imports": {
        "three": "https://cdn.jsdelivr.net/npm/three@0.175.0/build/three.module.js",
        "three/addons/": "https://cdn.jsdelivr.net/npm/three@0.175.0/examples/jsm/"
      }
    }
  </script>
  <script type="module">
    import * as THREE from "three";

    window.addEventListener("load", init);

    function init() {
      // シーンを作成
      const scene = new THREE.Scene();

      // カメラを作成
      const camera = new THREE.PerspectiveCamera(
        50, // 視野角
        window.innerWidth / window.innerHeight, // アスペクト比
        0.1, // 開始距離
        1000 // 終了距離
      );
      camera.position.set(0, 0, +1000); // カメラの位置を設定

      // レンダラーを作成
      const renderer = new THREE.WebGLRenderer({
        alpha: true // 背景を透過
      });
      // レンダラーのサイズをウィンドウサイズに設定
      renderer.setSize(window.innerWidth, window.innerHeight);
      // レンダラーのcanvas要素をbodyに追加 
      document.body.appendChild(renderer.domElement);

      // ジオメトリを作成
      const ballGeometry = new THREE.SphereGeometry(
        50, // 半径
        64, // 水平方向のセグメント数（経度方向）
        32 // 垂直方向のセグメント数（緯度方向）
      );
      
      // テクスチャを追加
      const textures = new THREE.TextureLoader().load(TAKOYAKI_BASE64, () => {
        // テクスチャ読み込み完了後に再描画
        renderer.render(scene, camera); 
      });
      // マテリアルを作成
      // const ballMaterial = new THREE.MeshPhysicalMaterial();
      const ballMaterial = new THREE.MeshPhysicalMaterial({ map: textures });
      // メッシュ化（ジオメトリとマテリアルを結合）
      const ballMesh = new THREE.Mesh(ballGeometry, ballMaterial);
      // シーンに追加
      scene.add(ballMesh);

      // 平行光源を追加
      const directionalLight = new THREE.DirectionalLight(
        0xffffff, // 光の色
        5 // 光の強さ
      );
      // 光源の位置を設定
      directionalLight.position.set(1, 1, 1);
      // シーンに追加
      scene.add(directionalLight);

      // シーンとカメラを使ってレンダリングを実行
      renderer.render(scene, camera);

      function animate() {
        // たこやきを円軌道で動かす
        ballMesh.position.set(
          200 * Math.sin(Date.now() / 500), // x座標：左右
          0, // y座標：上下（動かさない）
          200 * Math.cos(Date.now() / 500) + 200 // z座標：前後
        );
        renderer.render(scene, camera); // 画面を更新
        requestAnimationFrame(animate); // 次もまた実行するように予約
      }
      animate(); // アニメーション開始
    }
